    "minnesota-valley-national-wildlife-refuge-annual-narrative-report-calendar-year-1988",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Minnesota
    Valley National Wildlife Refuge outlines Refuge accomplishments during the 1988
    calendar year. The report begins with a summary of the year's highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which discusses the master plan, management planning, public participation, compliance
    with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, safety, and technical assistance is given. Habitat
    management is also covered; subjects include wetlands, forests, croplands, grasslands,
    haying, fire management, and pest control. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, other migratory birds, game mammals, other resident
    wildlife, fisheries, wildlife propagation and stocking, animal damage control, and
    marking and bird banding. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
    observation, off-road vehicling, other non-wildlife oriented recreation, and law
    enforcement. The equipment and facilities section of the report provides information
    about new construction, rehabilitation, major maintenance, equipment utilization
    and replacement, communication systems, computer use development, and energy development.
    Cooperative programs and items of interest are provided at the end. Refuge brochures
    are attached.",nt"license_title": "License Not Specified",nt"extras":
